import { render } from "react-dom";
import { View, StyleSheet, Modal, Button, Text } from "react-native";

function onChange() {
  return (
    <View>
      <Modal animationType="fade">
        <Text>HOLA</Text>
      </Modal>
    </View>
  );
}

const NoteModal = () => {
  function onChange() {
    return (
      <View>
        <Modal animationType="fade" style={styles.modal}>
          <Text>HOLA</Text>
        </Modal>
      </View>
    );
  }

  return (
    <View>
      <Button title="press me" onPress={onChange}>
        HI
      </Button>
    </View>
  );
};

const styles = StyleSheet.create({
  button: {
    width: 100,
    height: 100
  },
  modal: {
    height: 100,
    marginTop: 100,
    marginBottom: 100
  }
});

export default NoteModal;
